const Button = (props) => {
  const handleClick = e => {
    e.preventDefault();
    props.onClick();
  }

  return (
    <>
      <div className="rounded-md shadow-purple">
        <button type={props.type} onClick={handleClick}
           className="flex items-center justify-center px-8 py-3 border border-transparent font-medium rounded-lg text-white bg-purple-800 hover:bg-purple-700">
          {props.children}
        </button>
      </div>
    </>
  );
};

export default Button;
